sys_variable_value.value:
(function parse(inputs, outputs) {
    // Source item string is available in inputs.sourceItem.
    // Generate output by setting fields of outputs.targetObject.
    // 
    // The structure of outputs.targetObject corresponds to the
    // structure defined in the Data Stream Action output.

    // Parse glacier record properties into the outputs.targetObject
    // that is passed to the Data Stream Action Outputs.
    var glacier_rec = JSON.parse(inputs.sourceItem);
    outputs.targetObject.id = glacier_rec.glacier_id;
    outputs.targetObject.name = glacier_rec.name;
    outputs.targetObject.country = glacier_rec.country;
    outputs.targetObject.latitude = glacier_rec.latitude;
    outputs.targetObject.longitude = glacier_rec.longitude;

})(inputs, outputs);

(function paginate(variables, pageResponse) {
    // The script determines whether to retrieve another
    // page of glacier records from the web service.

    // Calculate how many records to retrieve then determine
    // the ordinal number of the last glacier to get
    var totalRecs = parseInt(variables.glaciers_per_page) * parseInt(variables.num_pages);
    var lastRec = parseInt(variables.start_with) + totalRecs;

    // If the value of variables.glacier_number is less than the
    // ordinal of the last record to get, get another page.   
    // If not, set variables.getNextPage to false.
    if (parseInt(variables.glacier_number) < lastRec) {
        variables.getNextPage = true;
    } else {
        variables.getNextPage = false;
    }
})(variables, pageResponse);

